pragma solidity ^0.8.7;

import '@openzeppelin/contracts/token/ERC721/ERC721.sol';
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";


error FundingContract__TransferFailed();
error FundingContract__NotEnoughETH();
error FundingContract__NotGroupFunding();

contract FundingContract is ERC721, Ownable {

    using SafeMath for uint256;
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    Counters.Counter private _withdrawers;

    uint256 private s_totalAmount;
    uint256 private s_withdrawalFee;
    uint256 private s_vestingPeriod;
    bool private _isGroupWithdrawal;

    mapping(address => uint256) private s_addressToAmountFunded;
    address[] s_funders;

    mapping(uint256 => mapping(address => bool)) private s_requestForWithdrawal; 



    modifier onlyGroupFunding() {
        if(!_isGroupWithdrawal){
            revert FundingContract__NotGroupFunding();
        }
       _;
    }

    constructor(
        uint256 totalFunding,
        uint256 withdrawalFee,
        uint256 vestingPeriod,
        bool isGroupWithdrawal
    ) ERC721('FundingContractToken', 'FCT'){

        s_totalAmount = totalFunding;
        s_withdrawalFee = withdrawalFee;
        s_vestingPeriod = vestingPeriod;
        _isGroupWithdrawal = isGroupWithdrawal;
    }



    function depositFunds() public payable{

        uint256 minFundingAmount = getMinimumFundingAmount();
        uint256 currentTokenId = _tokenIds.current();

        if(msg.value <= minFundingAmount){
            revert FundingContract__NotEnoughETH();
        }
        s_addressToAmountFunded[msg.sender] = msg.value;
        s_funders.push(msg.sender);
        _safeMint(msg.sender, currentTokenId);
        _tokenIds.increment();


    }

    function tokenURI(uint256 tokenId) public view virtual override returns (string memory){
        /**
         *  TODO 
         * 
         */
    }

    function claim() public {
        /**
         * TODO
         * 
         */
    }

    function requestForWithdrawal(uint256 tokenId) public onlyGroupFunding {
        s_requestForWithdrawal[tokenId][msg.sender] = true;
        _withdrawers.increment();
    }

    // Receive any funds sent to the contract
    receive() external payable {}

    function withdrawalCheck() public onlyGroupFunding returns(bool){
        uint256 numberOfWithdrawers = _withdrawers.current();
        uint256 withdrawalLimit = s_funders.length.mul(60).div(100);
        if(numberOfWithdrawers >= withdrawalLimit){
            return true;
        }
        return false;
    }



    function withdrawFunds() public onlyOwner{
        if(_isGroupWithdrawal){
            require(withdrawalCheck(), 'There is no majority approval to withdraw');
        }
        uint256 amount = address(this).balance;
        (bool success, ) = payable(msg.sender).call{value:amount}("");
        if(!success){
            revert FundingContract__TransferFailed();
        }
    }

    function getMinimumFundingAmount() public view returns(uint256){
        return s_totalAmount.div(s_vestingPeriod);
    }

    function getTotalAmount() public view returns(uint256){
        return s_totalAmount;
    }


    function getWithdrawalFee() public view returns(uint256){
        return s_withdrawalFee;
    }

    function getVestingPeriod() public view returns(uint256){
        return s_vestingPeriod;
    }

    function getIsGroupWithdrawal() public view returns(bool){
        return _isGroupWithdrawal;
    }

    function getAddressToAmountFunded(address funder) public view returns(uint256){
        return s_addressToAmountFunded[funder];
    }

    function getFunder(uint256 index) public view returns(address){
        return s_funders[index];
    }



}","keccak256":"0xede618187e17057a09a894725311c2e849f881a415bc1e1377c16d53a7ce0b1d","license":"MIT"},"contracts/PGFFactory.sol":{"content":"//SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

import "./FundingContract.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlEnumerableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

contract PGFFactory is AccessControlEnumerableUpgradeable, ReentrancyGuardUpgradeable, UUPSUpgradeable{

    // State Variable
    uint256 public s_creationFee;
    address public s_payoutAddress;
    uint256 public s_fundingId;
    mapping(uint => address) private s_fundingIdToAddress;
    uint256 public s_contractBalance;

    // Constant variables
    bytes32 public constant PAYOUTADDRESS_ROLE = keccak256("PAYOUTADDRESS_ROLE");
    bytes32 public constant CREATIONFEE_ROLE = keccak256("CREATIONFEE_ROLE");

    // Events
    event FundingCreated (
        address indexed contractAddress,
        uint256 indexed totalFunding,
        uint256 indexed vestingPeriod,
        uint256 withdrawalFee
    );

    event Withdrawed (
        address indexed payoutAddress,
        uint256 indexed amount
    );

    event CreationFeeChanged (
        uint256 indexed newCreationFee
    );

    event PayoutAddressChanged (
        address indexed newPayoutAddress
    );


    // Modifiers
    modifier isEnoughEther() {
        require(msg.value>= s_creationFee,"Ether sent should be equal or more than creation fees");
        _;
    }

   function initialize(uint256 _creationFee, address _payoutAddress) initializer public {
        s_creationFee = _creationFee;
        s_payoutAddress = _payoutAddress;
        s_fundingId = 0;
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function _authorizeUpgrade(address) internal override onlyRole(DEFAULT_ADMIN_ROLE) {}

    // External Function
    function createFunding(uint256 _totalFunding, uint256 _withdrawalFee, uint256 _vestingPeriod,bool _isGroupWithdrawal) external payable isEnoughEther {
        FundingContract fundingContract = new FundingContract(_totalFunding,_withdrawalFee,_vestingPeriod,_isGroupWithdrawal);
        s_fundingIdToAddress[s_fundingId] = address(fundingContract);
        s_fundingId++;
        s_contractBalance += msg.value;
        emit FundingCreated(address(fundingContract), _totalFunding, _vestingPeriod, _withdrawalFee);
    }

    function withdraw() external nonReentrant {
        address payoutAddress = s_payoutAddress;
        uint256 contractBalance = s_contractBalance;
        (bool success, ) = payable(payoutAddress).call{value:contractBalance}("");
        require(success,"Withdraw not successfull");
        s_contractBalance = 0;
        emit Withdrawed(payoutAddress, contractBalance);
    }

    // Setter Functions
    function setCreationFee(uint256 _creationFee) external onlyRole(CREATIONFEE_ROLE) {
        s_creationFee = _creationFee;
        emit CreationFeeChanged(_creationFee);
    }

    function setPayoutAddress(address _payoutAddress) external onlyRole(PAYOUTADDRESS_ROLE) {
        require(_payoutAddress != address(0),"Address cant be zero");
        s_payoutAddress = _payoutAddress;
        emit PayoutAddressChanged(_payoutAddress);
    }

    // View Functions
    function getAddress(uint256 _fundingId) external view returns(address){
        return s_fundingIdToAddress[_fundingId];
    }
}","keccak256":"0xb4ab019868284fff3d24f86926a7921fab40083264966b81fe2fd293ab64c75e","license":"MIT"}},"version":1}
